		311A21811794C8F2007BF879 /* Run Script */ = {
			isa = PBXShellScriptBuildPhase;
			buildActionMask = 2147483647;
			files = (
			);
			inputPaths = (
			);
			name = "Run Script";
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Version 3.0 (updated for Xcode 5, with support for 64 bit)\n# Changes:\n#    - most output locations have changed! 3.0 has an entirely new directory structure.\n#    - updated for Xcode 5, backwards compatibility is yet to be checked\n#    - adding build steps for ARM64, as well as x64_86 (64-bit simulator)\n#    - lipo still called only once\n#\n#################v\n# Purpose:\n#   Create a static library for current iPhone & Simulator architectures from within XCode\n#\n#################[ Tests: helps workaround any future bugs in Xcode ]########\n#\nDEBUG_THIS_SCRIPT=\"true\"\n\nif [ $DEBUG_THIS_SCRIPT = \"true\" ]; then\n echo \"########### TESTS #############\"\n echo \"Use the following variables when debugging this script; note that they may change on recursions\"\n echo \"BUILD_DIR = $BUILD_DIR\"\n echo \"BUILD_ROOT = $BUILD_ROOT\"\n echo \"CONFIGURATION_BUILD_DIR = $CONFIGURATION_BUILD_DIR\"\n echo \"BUILT_PRODUCTS_DIR = $BUILT_PRODUCTS_DIR\"\n echo \"CONFIGURATION_TEMP_DIR = $CONFIGURATION_TEMP_DIR\"\n echo \"TARGET_BUILD_DIR = $TARGET_BUILD_DIR\"\n echo \"SYMROOT = $SYMROOT\"\nfi\n\n\n#####################[ part 1 ]##################\n# First, work out the BASESDK version number (NB: Apple ought to report this, but they hide it)\n#    (incidental: searching for substrings in sh is a nightmare! Sob)\nSDK_VERSION=$(echo ${SDK_NAME} | grep -o '.\\{3\\}$')\nIPHONE_SDK=iphoneos${SDK_VERSION}\nSIMULATOR_SDK=iphonesimulator${SDK_VERSION}\n\n################################################\n# Invoke the builds for all the different architechures\n################################################\nACTION=\"build clean\"\n\nif [ $DEBUG_THIS_SCRIPT = \"true\" ]; then\n rm -rf \"${SYMROOT}/${CONFIGURATION}\"\n ACTION=\"build\" #faster, but less safe\nfi\n\nTARGET_SCHEME=\"AppBlade\"\nLIBRARY_NAME=libAppBlade.a\n\n\nARM_TARGET_DIR=${SYMROOT}/${CONFIGURATION}/build-arm\nARM_TARGET_BUILD_DIR=${ARM_TARGET_DIR}/${LIBRARY_NAME}\n\ni386_TARGET_DIR=${SYMROOT}/${CONFIGURATION}/build-i386\ni386_TARGET_BUILD_DIR=${i386_TARGET_DIR}/${LIBRARY_NAME}\n\nARM64_TARGET_DIR=${SYMROOT}/${CONFIGURATION}/build-arm64\nARM64_TARGET_BUILD_DIR=${ARM64_TARGET_DIR}/${LIBRARY_NAME}\n\nx6864_TARGET_DIR=${SYMROOT}/${CONFIGURATION}/build-x86_64\nx6864_TARGET_BUILD_DIR=${x6864_TARGET_DIR}/${LIBRARY_NAME}\n\nSHARED_BUILD_SETTINGS=\"-workspace AppBlade.xcodeproj/project.xcworkspace/ -PBXBuildsContinueAfterErrors=false  -scheme ${TARGET_SCHEME} -configuration ${CONFIGURATION} \"\n\necho \"Building Device version\"\nxcodebuild ${SHARED_BUILD_SETTINGS} -sdk \"${IPHONE_SDK}\" ${ACTION} ARCHS='armv7 armv7s' IPHONEOS_DEPLOYMENT_TARGET='5.0' TARGET_BUILD_DIR=\"${ARM_TARGET_DIR}\" BUILT_PRODUCTS_DIR=\"${ARM_TARGET_DIR}\"\n#test if succeeded\nif [ ! -f \"${ARM_TARGET_BUILD_DIR}\" ]; then\n echo \"Building ARM7 ARM7s version failed with errors\"\n exit 1\nfi\n\n\necho \"Building Simulator version\"\nxcodebuild ${SHARED_BUILD_SETTINGS} -sdk \"${SIMULATOR_SDK}\" ${ACTION} ARCHS='i386' IPHONEOS_DEPLOYMENT_TARGET='5.0' TARGET_BUILD_DIR=\"${i386_TARGET_DIR}\" BUILT_PRODUCTS_DIR=\"${i386_TARGET_DIR}\"\n#test if succeeded\nif [ ! -f \"${i386_TARGET_BUILD_DIR}\" ]; then\n echo \"Building i386 version failed with errors\"\n exit 1\nfi\n\n\necho \"Building 64-bit Device version\"\nxcodebuild ${SHARED_BUILD_SETTINGS} -sdk \"${IPHONE_SDK}\" ${ACTION} ARCHS='arm64' IPHONEOS_DEPLOYMENT_TARGET='7.0' TARGET_BUILD_DIR=\"${ARM64_TARGET_DIR}\" BUILT_PRODUCTS_DIR=\"${ARM64_TARGET_DIR}\"\n#test if succeeded\nif [ ! -f \"${ARM64_TARGET_BUILD_DIR}\" ]; then\n  echo \"Building ARM64 version failed with errors\"\n  exit 1\nfi\n\n\necho \"Building 64-bit Simulator version\"\nxcodebuild ${SHARED_BUILD_SETTINGS} -sdk \"${SIMULATOR_SDK}\" ${ACTION} ARCHS='x86_64' VALID_ARCHS='x86_64' IPHONEOS_DEPLOYMENT_TARGET='7.0' TARGET_BUILD_DIR=\"${x6864_TARGET_DIR}\" BUILT_PRODUCTS_DIR=\"${x6864_TARGET_DIR}\"\n#test if succeeded\nif [ ! -f \"${x6864_TARGET_BUILD_DIR}\" ]; then\n echo \"Building ARM64 Simulator version failed with errors\"\n exit 1\nfi\n\n\n################################################\n# Lipo all the architechures together\n################################################\n\nUNIVERSAL_LIBRARY_NAME=libAppBladeUniversal.a\nUNIVERSAL_DIR=${SYMROOT}/${CONFIGURATION}/universal-build\n\necho \"Taking device build from: ${ARM_TARGET_BUILD_DIR}\"\necho \"Taking simulator build from: ${i386_TARGET_BUILD_DIR}\"\necho \"Taking 64bit device build from: ${ARM64_TARGET_BUILD_DIR}\"\necho \"Taking 64bit simulator build from: ${x6864_TARGET_BUILD_DIR}\"\n\n# ... remove ALL possible output of previous lipos of this script\nrm -rf \"${UNIVERSAL_DIR}\"\nmkdir \"${UNIVERSAL_DIR}\"\n\necho \"lipo: for current configuration (${CONFIGURATION}) creating output file: ${CREATING_UNIVERSAL_DIR}/${LIBRARY_NAME}\"\nlipo -create \"${ARM_TARGET_BUILD_DIR}\" \"${i386_TARGET_BUILD_DIR}\"  -output \"${UNIVERSAL_DIR}/${UNIVERSAL_LIBRARY_NAME}\"\n\n#\"${ARM64_TARGET_BUILD_DIR}\" \"${x6864_TARGET_BUILD_DIR}\"\n\n#test if succeeded\nif [ ! -f \"${UNIVERSAL_DIR}/${UNIVERSAL_LIBRARY_NAME}\" ]; then\n echo \"Build failed at lipo step\"\n exit 1\nfi\n\nlipo -info \"${UNIVERSAL_DIR}/${UNIVERSAL_LIBRARY_NAME}\"\n\n\n# also copy \"include\" files\ncp \"${CONFIGURATION_BUILD_DIR}/usr/local/include/\"* \"${UNIVERSAL_DIR}\"\necho \"...I will output a universal build with header files to: ${UNIVERSAL_DIR}\"\n\n#########\n# Helpful bonus stuff\nrm -rf \"./build/AppBlade.build\" //just remove the intermediate build folder\n\n#open the finder window on completion\nopen \"${UNIVERSAL_DIR}\" #comment this line out to skip the (annoying) finder window opening\n\n#to reduce confusion, remove the other build folders\n#rm -rf \"${ARM_TARGET_DIR}\"\n#rm -rf \"${i386_TARGET_DIR}\"\n#rm -rf \"${ARM64_TARGET_DIR}\"\n#rm -rf \"${x6864_TARGET_DIR}\"\n#fi";
		};
