ystem_docset_path}\n\n#tell application \"Xcode\"\n#load documentation set with path${system_docset_path}\n#\"${system_docset_path}\"\n#end tell\necho \"loaded documentation set ${project_docset_path} to path \\\"${system_docset_path}\\\"\"\necho \"YOU MUST RESTART XCODE BEFORE THE DOCUMENTATION WILL APPEAR\"";
